import React from 'react';
import styled from 'styled-components';

const Card = styled.div``;
const PostCard = ({ post }) => {
	return (
		<div>
			<Card>
				<Image />
				<Content></Content>
				<Button></Button>
			</Card>
		</div>
	);
};

export default PostCard;
